INSERT INTO `t_organization` VALUES (1302965008253911041, '永修县行政服务中心', 'YXXZWZX', 'govCenter', '/upload/20200907/ys_693335f5361c4a25933351890104e934.jpeg', '九江市永修县开元大道(永修县人民政府)', '上午：09：00-11：30    下午：2：00-5：30', '0791-88919620', '永修县行政服务中心（以下简称中心）于2003年4月成立运行，为县政府正科级全额拨款的参照公务员管理派出机构。', NULL, 115.838618, 29.017914, '2020-09-07 21:40:41', 1, NULL, NULL, 0, 0);
