INSERT INTO `t_organization` VALUES (1302972473787875329, '永修县城市管理局', 'YXXCSGLJ', 'administrativeUnit', '/upload/20200907/ys_f4bdf061350d4d4abc9d8476f92af2e7.jpeg', '建昌西路49号', '上午：8：30-11：50    下午：2：30-5：30', '0792-3231311', '城管负责本市城管监察行政执法的指导、统筹协调和组织调度工作。本市城管监察行政执法队伍的监督和考核工作。贯彻实施国家及本市有关城市管理方面的法律、法规及规章，治理和维护城市管理秩序。', NULL, 115.814224, 29.027125, '2020-09-07 22:10:20', 1, NULL, NULL, 0, 0);
INSERT INTO `t_organization` VALUES (1302974281730031617, '永修县人民法院', 'YXXRMFY', 'administrativeUnit', '/upload/20200907/ys_bcb918cc7a7645ef91c4f443dd85e20d.png', '永修县建昌大道14号', '上午：08:00-12:00 （全年 ）下午：5月至9月为：15:00-18:30  ，10月至4月为： 14:30-18:30 ', '0792-3265608', '        永修县人民法院成立于1950年，现坐落于永修县建昌大道14号。永修县人民法院位于永修县城建昌大道，成立于1950年，目前内设办公室、政工科、立案庭等12个职能部门及涂埠、立新、虬津、白槎4个派出法庭。法院现有在编人员67人，全部具有大专以上学历，其中研究生学历4人，大学本科学历56人，专科学历7人，具有法官职称的45人，其他工作人员22人。', NULL, 115.817699, 29.015140, '2020-09-07 22:17:32', 1, NULL, NULL, 0, 0);
