  `description` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '简介',
  `real_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '真实姓名',
  `identity_no` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '身份证号码',
  `email` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '邮箱',
  `phone` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '电话号码',
  `sex` int(1) NULL DEFAULT 0 COMMENT '性别，0：男，1：女',
  `post_code` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '邮政编码',
  `level` int(1) NULL DEFAULT NULL COMMENT '级别',
  `level_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '级别名称',
  `create_user_id` bigint(20) NULL DEFAULT NULL COMMENT '创建者ID',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `last_update_time` datetime(0) NULL DEFAULT NULL COMMENT '最后一次修改时间',
  `last_update_user_id` bigint(20) NULL DEFAULT NULL COMMENT '最后一次修改者ID',
  `delete_flag` int(1) NULL DEFAULT 0 COMMENT '删除标志，0：未删除，1：已删除',
  `version` bigint(20) NULL DEFAULT 0 COMMENT '版本，分布式事务标志',
  `state` int(1) NULL DEFAULT 1 COMMENT '状态，1：启用；0：冻结',
  `salt` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '盐',
  `position_id` bigint(20) NULL DEFAULT 0 COMMENT '职位id',
  `dept` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `deptid` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `station_id` bigint(20) NULL DEFAULT NULL COMMENT '岗位id',
  `de_id` int(11) NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `IDX_USERNAME`(`user_name`) USING BTREE,
  INDEX `IDX_PHONE`(`phone`) USING BTREE,
  INDEX `delete_flag_index`(`delete_flag`) USING BTREE,
  INDEX `IDX_IDENTITY_NO_DELETE_FLAG`(`identity_no`, `delete_flag`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = DYNAMIC;

